import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Container
  } from "@mui/material";

  function HomePage() {
    return (
      <Container
        fixed
        sx={{
          bgcolor: "grey",
          marginTop: '10vh', 
          marginBottom: '10vh',
          width: "100%",
          height: "100vh"
        }}
      >
        <Box sx={{ pt: "10px" }}>
          <Box name='left'
            sx={{justifyContent: "center"}}
          >
            <h1>Left</h1>
          </Box>
          <Box name='right'>

          </Box>
        </Box>
      </Container>
    );
  }

  export default HomePage;
